import React from "react";
import { Link } from "react-router-dom";
import { Menu, Icon } from 'antd';
import './styling/app.css';
const SubMenu = Menu.SubMenu;



function Header() { 
  return (
    <Menu
    style={{ width: 256 }}
    defaultSelectedKeys={['1']}
    defaultOpenKeys={['sub1']}
    mode="inline"
    color="white"
  >

    <SubMenu className='nAv' key="sub2" title={<span><Icon type="appstore" /><span>Welcome</span></span>}>
      <Menu.Item style={{color:'white'}} key="5"><Link to="/">Home</Link></Menu.Item>
      <Menu.Item style={{color:'white'}} key="6"><Link to="/first">First</Link></Menu.Item>
      <SubMenu style={{color:'white'}} key="sub3" title="Ready For More">
        <Menu.Item style={{color:'white'}} key="7"><Link to="/third">Second</Link></Menu.Item>
        <Menu.Item style={{color:'white'}} key="8"><Link to="/second">Signup</Link></Menu.Item>
      </SubMenu>
    </SubMenu>

  </Menu>
);
}

export default Header;
